import React from "react";
import styled from "styled-components";

const BaseStyled = styled.div`
  border-top: 1px solid #000;
  border-bottom: 1px solid #000;
  height: 100vh;
  width: 100%;
`;

const Base = (props) => {
  return <BaseStyled>{props.children}</BaseStyled>;
};

export default Base;
